(13, '{\"es\": \"DEVOLUCIÓN DE MERCADERÍAS CLIENTES\"}', NULL, '{\"es\": \"<p>Estimado Cliente; para realizar una Devolución se deberá:</p><p>1º) Solicitar vía e-mail a \\\"interdevoluciones@gmail.com\\\"&nbsp;el Formulario \\\"Devolución de Mercaderías\\\".\\n2º) Completar el mismo con todos los datos requeridos y adjuntarlo con la Mercadería a Devolver.\\n3º) Enviar la Devolución con Flete Pago por Transporte de Colectivo a Terminal Retiro.\\n4º) Al despachar la Devolución, es fundamental enviarnos al mail indicado, la fotografía de la Guía de Despacho.\\n(Existe un doble control entre la Policía de la Ciudad y Gendarmería y suelen solicitar tales requisitos)\\nCon el Formulario completo y la Fotografía de la Guía, nuestro Despachante la retirará de la Empresa de Colectivos.\\nLos gastos y la Mercadería en Devolución corren por cuenta y riesgo del Cliente.\\nRecordamos enviar los pedido vía WEB, E-MAIL o FAX, para evitar errores de aplicación\\n\\t\\t\\t\\t\\t\\n</p>\"}', NULL, NULL, 'zz', NULL, 'texto', 5, '2020-12-04 01:36:36', '2020-12-04 21:04:51'),
