(27, '{\"es\":\"\\u00bfSe puede echar cloro con una piscina de venecita?\"}', NULL, '{\"es\":\"<p>El cloro granulado en grueso al 90%, se diluye lentamente y prolonga su acci\\u00f3n protectora en el agua. El uso de este tipo de cloro se recomienda para piletas revestidas con venecitas, ya que en las piletas pintadas puede llegar a decolorar el fondo.<\\/p>\"}', NULL, NULL, 'zz', NULL, 'texto', 8, '2021-05-18 15:56:02', '2021-05-18 15:56:02'),
