(3, '{\"es\": \"VALVULAS DE MOTOR\"}', '{\"es\": \"<p>SHIN ICHI ENGINE VALVES antimagnéticas y tratadas según norma equipo original\\nActualmente nuestra linea de vávulas para motor se compone de 2 marcas DOKURO y SHIN ICHI. Por esta vía anunciamos que toda la linea DOKURO será reemplazada por SHIN ICHI. Por lo tanto la linea DOKURO seguirá hasta agotar stock.\\nUno de los temas que nos propusimos abordar en esta serie de informes técnicos, debido a la importancia que tiene para el buen desempeño del motor en general y de las válvulas en particular, fue el de la elevada temperatura que se genera normalmente durante la marcha del mismo. El excesivo calor, que puede llegar a comprometer el funcionamiento de un motor a combustión interna, es la inquietud constante de buena parte de la Industria Automotriz Mundial.</p>\"}', NULL, NULL, NULL, NULL, '[\"uploads/productos/blog-3.jpg\"]', 'cc', 1, 0, '{\"es\": \"valvulas-de-motor\"}', 3, '2020-11-30 18:44:33', '2020-11-30 18:44:33'),
